def get_icon():
    if not PATH.icon.exists():
        PATH.icon.mkdir(parents=True, exist_ok=True)

    for name, ico in icon_bs64.items():
        name = PATH.icon / name
        if not name.exists():
            logger.info("[globals] : %s" % name)
            name.write_bytes(b64decode(ico))

    icons = EasyDict()
    for ico in PATH.icon.glob("*.ico"):
        icons[ico.stem] = str(ico)

    return icons


